import React, {useState} from 'react'

export default function Login(){
    const [name, setName] = useState('');

    function User(e){
        e.preventDefault();
        setName(e.target.value);
    }
    return (
        <form>
            <label>User Name</label>
            <input type='text' name='name' value={name}  onChange={User} />
        </form>
    );
}
